import React, { useEffect, useState } from 'react'
import '../navigation.css'
import Button from './Button'
import Redirect from './Redirect'
import { useNavigate } from 'react-router-dom';

export default function NavBar(props) {
  const navigate = useNavigate()
  const [path, setPath] = useState('')

  useEffect(()=> {
    navigate(`/${path}`);
  })

  return (
    <div className='navbar'>
        <div onClick={()=>setPath('')} className="mainIcon"></div>
        <Button onClick={()=>setPath('faq')} text={"FAQ"} class={`button ${props.pressed==1 ? 'pressedBtn' : null}`}/>
        <Button onClick={()=>setPath('explore')} text={"Explore features"} class={`button ${props.pressed==2 ? 'pressedBtn' : null}`}/>
        <div className="rightButtons">
        <Button text={"Login"} class={"button"}/>
        <Button text={"Sign Up"} class={"buttonBright"}/>
        </div>

    </div>
  )
}
